import styles from './footer.module.css';

export default function Footer () {
    return (
        <div className={styles.footer}>
            <div className={styles.header}>
                Developed by: DarylAranha
            </div>
            <div>
                <i className="fa fa-github" style={{ fontSize:'36px' }}>
                    https://github.com/
                </i>

            </div>
        </div>
    );
}
